You can use localeCompare with the sensitivity option set to 'case' :
var arr = ['a', 'A', 'b', 'B'];
arr.sort((a, b) => a.localeCompare(b, undefined, { sensitivity: 'case' }));
console.log(arr);
['a', 'A', 'b', 'B']
The undefined second argument to localeCompare means that no particular locale should be used for the comparison, which is appropriate for a simple case-sensitive sort of letters.
