Here's a sample Spark job in Java that calculates the hit rate for the onsite attributed data based on the top frequent queries:

```java
import org.apache.spark.api.java.JavaRDD;
import org.apache.spark.api.java.JavaSparkContext;
import org.apache.spark.api.java.function.Function;
import org.apache.spark.api.java.function.Function2;
import scala.Tuple2;

import java.io.Serializable;
import java.util.HashMap;
import java.util.Map;

public class HitRateCalculator {
    public static void main(String[] args) {
        // Create a JavaSparkContext
        JavaSparkContext sc = new JavaSparkContext();

        // Load the onsite attributed data and top frequent queries
        JavaRDD<String> onsiteData = sc.textFile("path/to/onsite_data.txt");
        JavaRDD<String> topQueries = sc.textFile("path/to/top_queries.txt");

        // Convert the top frequent queries to a Set for efficient lookup
        final Map<String, Long> cache = new HashMap<>();
        final long cacheDuration = 12 * 60 * 60 * 1000; // 12 hours in milliseconds

        // Calculate the hit rate
        JavaRDD<Tuple2<String, String>> hitRateData = onsiteData.map(new Function<String, Tuple2<String, String>>() {
            @Override
            public Tuple2<String, String> call(String record) throws Exception {
                String[] fields = record.split(",");
                String query = fields[0];
                long timestamp = Long.parseLong(fields[1]);

                if (topQueries.collect().contains(query)) {
                    if (cache.containsKey(query)) {
                        long cachedTimestamp = cache.get(query);
                        if (timestamp - cachedTimestamp <= cacheDuration) {
                            return new Tuple2<>(query, "hit");
                        }
                    }
                    cache.put(query, timestamp);
                    return new Tuple2<>(query, "miss");
                }
                return new Tuple2<>(query, "miss");
            }
        });

        // Calculate the hit count and miss count
        Tuple2<Long, Long> hitMissCount = hitRateData.aggregate(new Tuple2<Long, Long>(0L, 0L),
                new Function2<Tuple2<Long, Long>, Tuple2<String, String>, Tuple2<Long, Long>>() {
                    @Override
                    public Tuple2<Long, Long> call(Tuple2<Long, Long> count, Tuple2<String, String> record) throws Exception {
                        if (record._2().equals("hit")) {
                            return new Tuple2<>(count._1() + 1, count._2());
                        } else {
                            return new Tuple2<>(count._1(), count._2() + 1);
                        }
                    }
                },
                new Function2<Tuple2<Long, Long>, Tuple2<Long, Long>, Tuple2<Long, Long>>() {
                    @Override
                    public Tuple2<Long, Long> call(Tuple2<Long, Long> count1, Tuple2<Long, Long> count2) throws Exception {
                        return new Tuple2<>(count1._1() + count2._1(), count1._2() + count2._2());
                    }
                });

        // Calculate the hit rate
        double hitRate = (double) hitMissCount._1() / (hitMissCount._1() + hitMissCount._2());

        // Print the hit rate
        System.out.println("Hit Rate: " + hitRate);

        // Stop the SparkContext
        sc.stop();
    }
}
```

